import React, { Component } from "react";
import { Link } from "react-router-dom";

export class Navbar extends Component {
  render() {
    return (
      <div>
        <nav>
          <ul className="nav">
            <li>
              <Link to="/" className="Home">
                BookNotes
              </Link>
            </li>
            <li>
              <Link to="/archives" className="btn btn-light All-Notes">
                All Notes
              </Link>
            </li>
          </ul>
        </nav>
      </div>
    );
  }
}
